import React,{ Component } from 'react';
import "./Hello.css";

class Hello extends Component {
    render() {
        return  (
            <div>
            <h1>Hello world</h1>
            <p>WELCOME TO REACT JS</p>
            </div>
        );
    }
}


export default Hello
